import React from "react";
import CssBaseline from "@material-ui/core/CssBaseline";

import Container from "@material-ui/core/Container";
const App = () => {
  return (
    <div>
      <React.Fragment>
        <CssBaseline />
        <Container maxWidth="sm" disableGutters style={{ borderstyle: 'solid',
  borderwidth: '5px' }}>
          <h1>HELLO</h1>
        </Container>
      </React.Fragment>
    </div>
  );
};

export default App;
